  /**
   * Define color shortcut methods on the console.
   * @function colors
   * @memberOf console
   * @param {string} color - the CSS color rule to apply
   * @example console.style('Wow, this is ' + console.colors.green('so much') + ' better!');
   */
  console.colors = {};
